(2,'Hoàng','https://media.foody.vn/usr/g98/971163/avt/c100x100/foody-avatar-364-636280699135848407.jpg','Thấy trên foody lâu rồi mà giờ mới có dịp ghé quá. Quán đông tấp nập, hết lượt này tới lượt khác vô liền. Nói chung là đồ ăn cũng ổn, giá hơi cao. Cánh gà chiên nước mắm bt có mấy miếng nhìn thảm chịu k nổi. Gửi xe mất 3k 😔 2 đứa k ăn lẩu mà hết 225k',3.8),
