create table category(
	id INTEGER   PRIMARY KEY  AUTOINCREMENT  NOT NULL,
	NAME nvarchar(50)
);
create table CateType(
	id INTEGER   PRIMARY KEY  AUTOINCREMENT  NOT NULL,
	NAME nvarchar(50)
);

create table type(
	id INTEGER   PRIMARY KEY  AUTOINCREMENT  NOT NULL,
	cateId int,
	typeId int,
	NAME nvarchar(50),
	imageURL varchar(200),
	COUNT numeric(10)
);








create table itemwhere(
			id INTEGER   PRIMARY KEY  AUTOINCREMENT  NOT NULL,
			 NAME TEXT,
             ADDRESS TEXT,
            CITYID int,
            DISTRICTID int,
			STREETID int,
            CATEGORYID int,
			TYPEID int,
			CATETYPEID int,
            AVGRATING TEXT,
            IMAGEURL TEXT,
            REVIEWS TEXT,
            PHOTOS TEXT,
            BOOKMARKS TEXT,
			HASMEMBERCARD bit,
			ISDELIVERY bit,
			ISBOOKING bit,
			ISCOLLECTION bit,
			ISUSER bit
);
